import React, { Component, Link } from 'react';

class Nav extends React.Component {
    render() {
        return <div><ul classNameName="navibar">
            <li classNameName="navibar_lien">
                <Link to="/">Liste des Gares</Link>
            </li>
            <li classNameName="navibar_lien">
                <Link to="/form">Rapport</Link>
            </li>
            {this.state.isAdmin ? (
                <li classNameName="navibar_lien">
                    <Link to="/formList">Liste des formulaires</Link>
                </li>
            ) : ("")}
            <li classNameName="navibar_lien">
                <button id="deco_button" onClick={this.logOut}>Deconnexion</button>
            </li>
        </ul>
        </div>;
    }
}

export default Nav;
